css:
.git-plus .alert {
  color: #d28b71;
}
.git-plus .success {
  color: #beb55b;
}
.git-plus.overlay {
  width: 600px;
}
.git-plus .info-view {
  overflow: auto;
}
.meta.diff.range.unified {
  color: #8ab3b5;
}
.meta.diff.header {
  color: #8ab3b5;
}
.markup.deleted.diff {
  color: #cb6077;
}
.markup.inserted.diff {
  color: #beb55b;
}
